  PRIMARY KEY (`f_nro`,`id_cuota`),
  KEY `Ref323` (`f_nro`),
  KEY `Ref1528` (`moneda`),
  CONSTRAINT `Reffactura_venta23` FOREIGN KEY (`f_nro`) REFERENCES `factura_venta` (`f_nro`),
  CONSTRAINT `Refmonedas28` FOREIGN KEY (`moneda`) REFERENCES `monedas` (`m_cod`)
